<h3>Mobile Name : {{mobileName}}</h3>
<h3>Price :{{'$'+Price}}</h3>
<h3>Color : {{color}}</h3>
<h3>Discounted Price : {{getDiscountedPrice()}}</h3>
<h3>{{inStock>0 ? 'only'+inStock+'in stock' : 'out of stock'}}</h3>
